const Test5 = () => {
  return (
    <>
    <div className='container my-4'>
        <div style={{ height : "200px", width : "200px", backgroundColor : "#fd41dd"}}></div>
        <div style={{ height : "200px", width : "200px", backgroundColor : "#704050"}}></div>
    </div>
    </>
  )
}

export default Test5
